B.L3=new A.b5([B.N,'You\'re not. **The data never leaves your machine.** This is a so-called "static web app". Everything happens on your local machine. No data is sent to any server. You could even turn off your internet connection while using it.\n\nStill sceptical? - This is an open source project. Feel free to check the source code on [https://github.com/Georgery/coffee_roulette](https://github.com/Georgery/coffee_roulette).',B.O,"Tust Du nicht. **Die Daten verlassen Dein Ger\xe4t nicht.** Dies ist eine statische Web-App. Alles passiert auf Deinem Ger\xe4t, keinerlei Daten werden an irgendeinen Server geschickt. Du kannst sogar Deine Internetverbindung kappen, wenn Du willst.\n\nImmernoch skeptisch? - Das ist ein Open-Source Projekt. Du kannst Dir den Quellcode anschauen, unter [https://github.com/Georgery/coffee_roulette](https://github.com/Georgery/coffee_roulette)."],t.O)
