B.L5=new A.b5([B.N,"- Enter the names of people you want to connect.\n - Match them into random groups.\n - Notify them about their groupings - potentially using the emails you added.\n - Create a file with the names, that you can just drag-and-drop next time.",B.O,"- Gib die Namen der Leute ein, die Du verbinden willst.\n - Erstelle zuf\xe4llige Gruppen.\n - Informiere die Leute \xfcber ihre Gruppe - potenziell mit den E-Mail-Adressen, die Du hinzugef\xfcgt hast.\n - Erstelle eine Datei mit den Namen - beim n\xe4chsten Mal kannst Du sie einfach per drag-and-drop einf\xfcgen."],t.O)
