B.L8=new A.b5([B.N,"You're in an organization. Not everybody knows each other. But maybe they should...\n\n**Connect people in randomized groups** or pairs, so they can meet and get to know each other. Once a week you can build and let them know about the random group composition. Only thing left is that they set up a call or meeting.\n\nThis fosters knowledge sharing and team building and connects people who otherwise wouldn't meet.",B.O,"Du bist in einer Organisation? Nicht alle kennen sich... aber sollten sie vielleicht?\n\n**Verbinde Leute in zuf\xe4lligen Gruppen** oder Paaren. Sie k\xf6nnen sich dann beim Kaffee kennenlernen. Jede Woche werden neue Gruppen ausgelost. Sie m\xfcssen sich dann nur noch treffen - online oder offline.\n\nDas f\xf6rdert das Wissensaustausch und Teambuilding und Kollaboration."],t.O)
